import React from "react";

const Restaurants=(props)=>{
    if(!props.restaurants.length){
        return
    }
    console.log('restaurants',props.restaurants)
    const display=props.restaurants.map((place)=>{
        return(
            <div className="card">
                <div className="card-content">
                    <h1>{place.name}</h1>
                </div>
                <div className="content align">
                    <div className="card-image">
                        <img src={place.photo.thumbnail.url}></img>
                    </div>
                    <div className="align">
                        <div>
                            <p>Rating:{Math.floor(parseInt(place.city_trans)*10)/10}</p>
                            <p>Cuisine:{place.cuisine[0].name}</p>
                            <p>Price:{place.price_level}</p>
                        </div>
                        <div>
                            {place.district?<p>Neighborhood:{place.neighborhood_info.name}</p>:<p></p>}
                            <href src={place.web_url}><i class="fa-solid fa-globe"></i></href>
                        </div>
                    </div>
                </div>
            </div>
        )
    })
    console.log('display',display)
    return(
        <div>
            <h1>Restaurants</h1>
            {display}
        </div>
    )
}

export default Restaurants
